James Newell Osterberg, Jr. (born April 21, 1947), better known by his stage name Iggy Pop, is an American rock singer, songwriter, and occasional actor. Although he has had only limited commercial success, Iggy Pop is considered an innovator of punk and related styles. He is sometimes referred to by the nicknames &quot;the Godfather of Punk&quot; and &quot;the Rock Iguana&quot;[citation needed], and is widely acknowledged as one of the most dynamic stage performers of rock. Pop began calling himself Iggy after his first band in high school, The Iguanas.





